import React from 'react';

function CardComponent({ imageUrl, title, description }) {
  return (
    <div style={{ border: '1px solid #ccc', padding: '10px', width: '300px', margin: '10px' }}>
      <img src={imageUrl} alt={title} style={{ width: '100%', height: 'auto' }} />
      <h3>{title}</h3>
      <p>{description}</p>
    </div>
  );
}

export default CardComponent;
